import "./days.css"
import { daysInMonth, month } from "../../date"

export default function Days() {
    const month = 0;
    const d = daysInMonth(month);
    const days = Array.from({length: d}, (_, i) => i + 1);
    return (
        <div className="days">
            {days.map((day, i) => {
                return (
                    <span className="day" key={i}>
                        {day}
                    </span>
                )
            })}
        </div>
    )
}
